import React, { Component } from "react";

export default class Home extends Component{
    render(){
        return(
        <div class="pf__title">
            <div class="pf__title--name">
                <p class="pf__title--name-f">Jubi</p> 
                <p class="pf__title--name-s">Chen</p>
            </div>
            <ul class="pf__title--menu">
            {/* style="color:#86858A" */}
                <li class="pf__title--menu-home" >Home</li>
                <li class="pf__title--menu-resume">Resume</li>
                <li class="pf__title--menu-services">Services</li>
                <li class="pf__title--menu-blog">Blog</li>
                <li class="pf__title--menu-contact">Contact</li>
            </ul>
     </div>)

    }
}
